import ProductCard from "./components/ProductCard"
import { getProducts } from "./api";
import './App.css';
function App() {
  getProducts().then(response => {
    console.log(response.data);
  }).catch(error => {
    console.error("Error fetching products:", error);
  });
  return (
    <div className="appcontainer">
      <ProductCard />
      <ProductCard />
      <ProductCard />
      <ProductCard />
      <ProductCard />
    </div>
  )
}

export default App
